// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/**
 * @title Marketplace
 * @dev Main contract for the blockchain e-commerce platform
 */
contract Marketplace {
    address public owner;
    uint256 public productCount = 0;
    uint256 public orderCount = 0;
    
    struct Product {
        uint256 id;
        string name;
        string description;
        uint256 price;
        address payable seller;
        bool isActive;
        uint256 stock;
    }
    
    struct Order {
        uint256 id;
        uint256 productId;
        uint256 quantity;
        uint256 totalPrice;
        address buyer;
        address seller;
        bool isCompleted;
        bool isCancelled;
    }
    
    mapping(uint256 => Product) public products;
    mapping(uint256 => Order) public orders;
    mapping(address => uint256[]) public userProducts;
    mapping(address => uint256[]) public userOrders;
    
    event ProductCreated(
        uint256 id,
        string name,
        uint256 price,
        address seller,
        uint256 stock
    );
    
    event ProductUpdated(
        uint256 id,
        string name,
        uint256 price,
        bool isActive,
        uint256 stock
    );
    
    event ProductPurchased(
        uint256 orderId,
        uint256 productId,
        uint256 quantity,
        uint256 totalPrice,
        address buyer,
        address seller
    );
    
    event OrderCompleted(uint256 orderId);
    event OrderCancelled(uint256 orderId);
    
    constructor() {
        owner = msg.sender;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }
    
    modifier onlySeller(uint256 _productId) {
        require(products[_productId].seller == msg.sender, "Only the seller can perform this action");
        _;
    }
    
    modifier onlyBuyer(uint256 _orderId) {
        require(orders[_orderId].buyer == msg.sender, "Only the buyer can perform this action");
        _;
    }
    
    /**
     * @dev Create a new product
     */
    function createProduct(
        string memory _name,
        string memory _description,
        uint256 _price,
        uint256 _stock
    ) public returns (uint256) {
        require(bytes(_name).length > 0, "Product name cannot be empty");
        require(_price > 0, "Product price must be greater than 0");
        require(_stock > 0, "Product stock must be greater than 0");
        
        productCount++;
        
        products[productCount] = Product({
            id: productCount,
            name: _name,
            description: _description,
            price: _price,
            seller: payable(msg.sender),
            isActive: true,
            stock: _stock
        });
        
        userProducts[msg.sender].push(productCount);
        
        emit ProductCreated(productCount, _name, _price, msg.sender, _stock);
        
        return productCount;
    }
    
    /**
     * @dev Update product details
     */
    function updateProduct(
        uint256 _productId,
        string memory _name,
        string memory _description,
        uint256 _price,
        bool _isActive,
        uint256 _stock
    ) public onlySeller(_productId) {
        require(_productId > 0 && _productId <= productCount, "Invalid product ID");
        require(bytes(_name).length > 0, "Product name cannot be empty");
        require(_price > 0, "Product price must be greater than 0");
        
        Product storage product = products[_productId];
        
        product.name = _name;
        product.description = _description;
        product.price = _price;
        product.isActive = _isActive;
        product.stock = _stock;
        
        emit ProductUpdated(_productId, _name, _price, _isActive, _stock);
    }
    
    /**
     * @dev Purchase a product
     */
    function purchaseProduct(uint256 _productId, uint256 _quantity) public payable returns (uint256) {
        require(_productId > 0 && _productId <= productCount, "Invalid product ID");
        
        Product storage product = products[_productId];
        
        require(product.isActive, "Product is not available for purchase");
        require(product.stock >= _quantity, "Not enough stock available");
        require(product.seller != msg.sender, "You cannot buy your own product");
        
        uint256 totalPrice = product.price * _quantity;
        require(msg.value >= totalPrice, "Insufficient funds sent");
        
        orderCount++;
        
        orders[orderCount] = Order({
            id: orderCount,
            productId: _productId,
            quantity: _quantity,
            totalPrice: totalPrice,
            buyer: msg.sender,
            seller: product.seller,
            isCompleted: false,
            isCancelled: false
        });
        
        userOrders[msg.sender].push(orderCount);
        
        // Update product stock
        product.stock -= _quantity;
        
        // Transfer funds to seller
        product.seller.transfer(totalPrice);
        
        // Refund excess payment
        if (msg.value > totalPrice) {
            payable(msg.sender).transfer(msg.value - totalPrice);
        }
        
        emit ProductPurchased(orderCount, _productId, _quantity, totalPrice, msg.sender, product.seller);
        
        return orderCount;
    }
    
    /**
     * @dev Complete an order (confirm receipt)
     */
    function completeOrder(uint256 _orderId) public onlyBuyer(_orderId) {
        require(_orderId > 0 && _orderId <= orderCount, "Invalid order ID");
        
        Order storage order = orders[_orderId];
        
        require(!order.isCompleted, "Order is already completed");
        require(!order.isCancelled, "Order is cancelled");
        
        order.isCompleted = true;
        
        emit OrderCompleted(_orderId);
    }
    
    /**
     * @dev Cancel an order (only owner can cancel for dispute resolution)
     */
    function cancelOrder(uint256 _orderId) public onlyOwner {
        require(_orderId > 0 && _orderId <= orderCount, "Invalid order ID");
        
        Order storage order = orders[_orderId];
        
        require(!order.isCompleted, "Order is already completed");
        require(!order.isCancelled, "Order is already cancelled");
        
        order.isCancelled = true;
        
        emit OrderCancelled(_orderId);
    }
    
    /**
     * @dev Get all products created by a seller
     */
    function getSellerProducts() public view returns (uint256[] memory) {
        return userProducts[msg.sender];
    }
    
    /**
     * @dev Get all orders placed by a buyer
     */
    function getBuyerOrders() public view returns (uint256[] memory) {
        return userOrders[msg.sender];
    }
    
    /**
     * @dev Get product details
     */
    function getProduct(uint256 _productId) public view returns (
        uint256 id,
        string memory name,
        string memory description,
        uint256 price,
        address seller,
        bool isActive,
        uint256 stock
    ) {
        require(_productId > 0 && _productId <= productCount, "Invalid product ID");
        
        Product memory product = products[_productId];
        
        return (
            product.id,
            product.name,
            product.description,
            product.price,
            product.seller,
            product.isActive,
            product.stock
        );
    }
    
    /**
     * @dev Get order details
     */
    function getOrder(uint256 _orderId) public view returns (
        uint256 id,
        uint256 productId,
        uint256 quantity,
        uint256 totalPrice,
        address buyer,
        address seller,
        bool isCompleted,
        bool isCancelled
    ) {
        require(_orderId > 0 && _orderId <= orderCount, "Invalid order ID");
        
        Order memory order = orders[_orderId];
        
        return (
            order.id,
            order.productId,
            order.quantity,
            order.totalPrice,
            order.buyer,
            order.seller,
            order.isCompleted,
            order.isCancelled
        );
    }
